import "./App.css";
import { Routes, Route, BrowserRouter as Router } from "react-router-dom";
import Ateliers from "./pages/Ateliers";
import UsersPage from "./pages/Users";
import Lavage from "./pages/Lavage";
import Sechage from "./pages/Sechage";
import Repassage from "./pages/Repassage";
import Rate from "./pages/Rate";

function App() {
  return (
    <div
      id="screen"
      className="w-screen min-h-screen flex justify-center items-center bg-igray flex-col space-y-28 scroll-smooth"
    >
      <Router>
        <Routes>
          <Route path="/rate/1/:id" element={<Rate />} />
          <Route path="/rate/2/:id" element={<Rate />} />
          <Route path="/rate/3/:id" element={<Rate />} />
          <Route path="/ateliers/:id" element={<Ateliers />} />
          <Route path="/ateliers/1/:id" element={<Lavage />} />
          <Route path="/ateliers/2/:id" element={<Sechage />} />
          <Route path="/ateliers/3/:id" element={<Repassage />} />
          <Route path="/" element={<UsersPage />} />
        </Routes>
      </Router>
    </div>
  );
}

export default App;
